(1,_binary '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0//EN\" \"http://www.w3.org/TR/REC-html40/strict.dtd\">\n<html><head><meta name=\"qrichtext\" content=\"1\" /><style type=\"text/css\">\np, li { white-space: pre-wrap; }\n</style></head><body style=\" font-family:\'Comic Sans MS\'; font-size:13pt; font-weight:400; font-style:normal;\">\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600; font-style:italic;\">MYDRIATICUM UNIDOSE</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600; font-style:italic;\">NEOSYNÉPHRINE 10%</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-style:italic;\">Une goutte de chaque dans ((Quel côté//COTE)), tous les 1/4 d\'heure, pendant l\'heure précédant le prochain examen</span></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p></body></html>','Dilatation',NULL,1,1,1,1,0),
(2,_binary '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0//EN\" \"http://www.w3.org/TR/REC-html40/strict.dtd\">\n<html><head><meta name=\"qrichtext\" content=\"1\" /><style type=\"text/css\">\np, li { white-space: pre-wrap; }\n</style></head><body style=\" font-family:\'Comic Sans MS\'; font-size:13pt; font-weight:400; font-style:normal;\">\n<p align=\"justify\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Comic Sans MS,12,-1,5,50,0,0,0,0,0\'; font-size:12pt; font-weight:600; font-style:italic;\">VITABACT </span><span style=\" font-family:\'Comic Sans MS,12,-1,5,50,0,0,0,0,0\'; font-size:12pt; font-style:italic;\">Une goutte dans chaque oeil, 3 fois par jour, pendant 6 jours, en commençant 48 heures avant le prochain examen.</span></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'Comic Sans MS,12,-1,5,50,0,0,0,0,0\'; font-size:12pt; font-style:italic;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Comic Sans MS,12,-1,5,50,0,0,0,0,0\'; font-size:12pt; font-weight:600; font-style:italic;\">HIBISCRUB</span><span style=\" font-family:\'Comic Sans MS,12,-1,5,50,0,0,0,0,0\'; font-size:12pt; font-style:italic;\"> 125ml Prendre une douche complète, corps et cheveux, la veille au soir et le matin de l\'injection. </span></p></body></html>','Injection intra-vitréenne',NULL,1,1,1,1,1),
(3,_binary '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0//EN\" \"http://www.w3.org/TR/REC-html40/strict.dtd\">\n<html><head><meta name=\"qrichtext\" content=\"1\" /><style type=\"text/css\">\np, li { white-space: pre-wrap; }\n</style></head><body style=\" font-family:\'Comic Sans MS\'; font-size:13pt; font-weight:400; font-style:normal;\">\n<p align=\"center\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">AVANT L\'INTERVENTION</span></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Instiller dans chaque œil</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">	MONOOX	4 fois par jour pendant la semaine précédant l\'intervention</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p align=\"center\" style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p align=\"center\" style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-weight:600;\"><br /></p>\n<p align=\"center\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">APRES L\'INTERVENTION</span></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">1) Instiller dans l\'œil opéré</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">	TOBRADEX	4 fois par jour pendant 10 jours</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">	MONOOX	4 fois par jour pendant 10 jours</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">	VISMED	4 fois par jour pendant un mois - 3 flacons - non substituable</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">2) reconsulter le lendemain matin à mon cabinet</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p></body></html>','Ordo réfractive',NULL,1,1,1,NULL,1),
(6,_binary '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0//EN\" \"http://www.w3.org/TR/REC-html40/strict.dtd\">\n<html><head><meta name=\"qrichtext\" content=\"1\" /><style type=\"text/css\">\np, li { white-space: pre-wrap; }\n</style></head><body style=\" font-family:\'Comic Sans MS\'; font-size:13pt; font-weight:400; font-style:normal;\">\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">MYDRIATICUM Unidoses</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-style:italic;\">Une goutte dans l\'æil opéré, 3 fois par jour pendant 3 jours</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">TOBRADEX</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-style:italic;\">Une goutte dans l\'æil opéré</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-style:italic;\"> 3 fois par jour pendant 2 semaines</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-style:italic;\"> puis 2 fois par jour pendant 1 semaine</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-style:italic;\"> puis une fois par jour pendant une semaine</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">MICROPORE SILICONE 2.5cm</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-style:italic;\">1 rouleau</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">COMPRESSES 30x30</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-style:italic;\">Faire un pansement tous les soirs avec la coque oculaire pendant 8 jours</span></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-style:italic;\">Reconsulter à mon cabinet dans les 24 heures suivant l\'intervention,</span><span style=\" font-weight:600; font-style:italic;\"> MÊME SI TOUT VA BIEN</span></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-style:italic;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-style:italic;\">En cas de problème, me recontacter ou contacter le service d\'ophtalmologie de l\'hôpital Nord de Marseille</span></p></body></html>','Ordonnance post-opératoire cataracte','Traitement post-opératoire Mydriaticum Ciloxan Dexafree',1,1,1,1,1),
(8,_binary '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0//EN\" \"http://www.w3.org/TR/REC-html40/strict.dtd\">\n<html><head><meta name=\"qrichtext\" content=\"1\" /><style type=\"text/css\">\np, li { white-space: pre-wrap; }\n</style></head><body style=\" font-family:\'Comic Sans MS\'; font-size:13pt; font-weight:400; font-style:normal;\">\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600; font-style:italic;\">ATROPINE 0.5%</span></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-weight:600; font-style:italic;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-style:italic;\">une goutte dans chaque oeil matin et soir pendant les 3 jours précédant l\'examen, y compris le matin de l\'examen.</span></p></body></html>','Skiascopie sous atropine','ARSA',1,1,1,1,1),
(9,_binary '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0//EN\" \"http://www.w3.org/TR/REC-html40/strict.dtd\">\n<html><head><meta name=\"qrichtext\" content=\"1\" /><style type=\"text/css\">\np, li { white-space: pre-wrap; }\n</style></head><body style=\" font-family:\'Comic Sans MS\'; font-size:13pt; font-weight:400; font-style:normal;\">\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">SKIACOL</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">une goutte dans chaque æil, trois fois de suite à 10 minutes d\'intervalle, une heure avant le prochain examen.</p></body></html>','Skiascopie sous skiacol','ARSS',1,1,1,1,1),
(10,_binary '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0//EN\" \"http://www.w3.org/TR/REC-html40/strict.dtd\">\n<html><head><meta name=\"qrichtext\" content=\"1\" /><style type=\"text/css\">\np, li { white-space: pre-wrap; }\n</style></head><body style=\" font-family:\'Comic Sans MS\'; font-size:13pt; font-weight:400; font-style:normal;\">\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Comic Sans MS,12,-1,5,50,0,0,0,0,0\'; font-size:12pt; font-weight:600; font-style:italic;\">MYDRIATICUM unidoses</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Comic Sans MS,12,-1,5,50,0,0,0,0,0\'; font-size:12pt; font-weight:600; font-style:italic;\">NEOSYNÉPHRINE 10%</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Comic Sans MS,12,-1,5,50,0,0,0,0,0\'; font-size:12pt;\">Une goutte de chaque dans </span>((quel côté//COTE))<span style=\" font-family:\'Comic Sans MS,12,-1,5,50,0,0,0,0,0\'; font-size:12pt;\">, tous les 1/4 d\'heure, pendant l\'heure précédant le prochain examen</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Comic Sans MS,12,-1,5,50,0,0,0,0,0\'; font-size:12pt; font-weight:600; font-style:italic;\">LACRIGEL 10g</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Comic Sans MS,12,-1,5,50,0,0,0,0,0\'; font-size:12pt;\">Un tube</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Comic Sans MS,12,-1,5,50,0,0,0,0,0\'; font-size:12pt; font-weight:600; font-style:italic;\">CEBESINE</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Comic Sans MS,12,-1,5,50,0,0,0,0,0\'; font-size:12pt;\">Un tube</span></p></body></html>','V3M laser','AR pour V3M',1,1,1,1,0),
(11,_binary '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0//EN\" \"http://www.w3.org/TR/REC-html40/strict.dtd\">\n<html><head><meta name=\"qrichtext\" content=\"1\" /><style type=\"text/css\">\np, li { white-space: pre-wrap; }\n</style></head><body style=\" font-family:\'Comic Sans MS\'; font-size:13pt; font-weight:400; font-style:normal;\">\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Comic Sans MS,11,-1,5,50,0,0,0,0,0\'; font-size:12pt;\">Je, soussigné {{TITREUSER}}, certifie que {{TITRE PATIENT}} {{PRENOM PATIENT}} {{NOM PATIENT}} est porteur(se) de lentilles de contact.</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Comic Sans MS,11,-1,5,50,0,0,0,0,0\'; font-size:12pt;\">Avec ses lentilles ou ses lunettes, son acuité visuelle est de 10/10 à chaque œil. Certificat fait à la demande de l’intéressé(e) et remis en main propre pour servir et valoir ce que de droit. </span></p></body></html>','Certificat lentilles',NULL,1,1,NULL,NULL,1),
(12,_binary '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0//EN\" \"http://www.w3.org/TR/REC-html40/strict.dtd\">\n<html><head><meta name=\"qrichtext\" content=\"1\" /><style type=\"text/css\">\np, li { white-space: pre-wrap; }\n</style></head><body style=\" font-family:\'Comic Sans MS\'; font-size:13pt; font-weight:400; font-style:normal;\">\n<p align=\"center\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:17pt; font-weight:600;\">Opération de la cataracte</span></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-size:17pt; font-weight:600; font-style:italic;\"><br /></p>\n<p align=\"center\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">Intervention de cataracte de ((Côté de l\'intervention//COTEINTERVENTION)) du ((Date d\'intervention//DATEINTERVENTION))</span></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-weight:600;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">{{TITRE PATIENT}} {{PRENOM PATIENT}} {{NOM PATIENT}}</span>,</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Vous êtes atteint(e) d\'une cataracte responsable de vos troubles visuels. Votre ophtalmologiste vous propose l\'opération, car la chirurgie constitue le seul moyen d\'améliorer votre vision.</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Cette fiche contient l\'information sur l\'opération qui vous est proposée, sur ses résultats et sur ses risques.</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">La cataracte</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Elle correspond à l\'opacification du cristallin, lentille de forte puissance située à l\'intérieur de l\'oeil (objectif d\'un appareil photographique).</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Pourquoi opérer la cataracte ?</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Parce que ni les collyres, ni le laser ne peuvent guérir une cataracte constituée.</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">L\'opération de la cataracte</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">L\'intervention est réalisée alors que le patient est installé sur le dos, en milieu chirurgical stérile et sous microscope. Elle représente un geste chirurgical majeur, car elle consiste à inciser l\'oeil et à en extraire l\'un de ses éléments internes, le cristallin.</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">• Hospitalisation :</span> Une immobilisation minimale de quelques heures est nécessaire. Le mode d\'hospistalisation adapté à votre cas vous sera proposé par votre ophtalmologiste en accord avec l\'anesthésiste.</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">• Anesthésie :</span> L\'oeil peut être insensibilisé par des injections de voisinage, ou uniquement par l\'instillation de gouttes. Une anesthésie générale est également possible.</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Le choix résulte de l\'avis de votre ophtalmologiste et de celui du médecin anesthésiste. Il prend en compte, si possible, votre souhait.</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">• L\'extraction de la cataracte</span> est réalisée avec ou sans l\'aide d\'une sonde à ultrasons. L\'enveloppe du cristallin (la capsule) est laissée en place. Il est exceptionnel de procéder à l\'extraction totale du cristallin.</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">• Implantation d\'un cristallin artificiel</span> (implant intra-oculaire) : le cristallin est remplacé par une lentille synthétique placée derrière la pupille.</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">• L\'incision de l\'oeil est suturée ou non.</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">• Incidents ou difficultés peropératoires :</span> ils sont rares et imprévisibles. Ils conduisent parfois à placer l\'implant devant la pupille, voire à renoncer à toute implantation. Il peut être nécessaire d\'enlever un petit fragment de l\'iris et/ou de procéder à l\'ablation d\'une partie du vitré.</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Le déroulement de l\'intervention peut être compliqué par une rupture de la capsule (moins de 5% des cas). L\'extraction de la cataracte est parfois incomplète. Une hémorragie peut se produire et se résorbe en général en quelques jours (dans des cas très exceptionnels, elle peut aboutir à la perte de la vision, voire à la perte de l\'oeil).</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">L\'évolution postopératoire habituelle</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">• Dans la très grande majorité des cas (95%), l\'oeil opéré de cataracte est indolore. La vision</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">s\'améliore très rapidement et une correction adaptée par lunettes peut être prescrite au bout de quelques semaines.</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">La présence d\'autres lésions de l\'oeil peut limiter la récupération visuelle.</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">• Les soins locaux sont réduits à l\'instillation de gouttes, à l\'application d\'une pommade et au port d\'une protection oculaire selon des modalités et durant une période qui vous seront précisées par votre chirurgien. Il est parfois nécessaire de procéder à l\'ablation de fils de suture. L\'activité professionnelle, l\'utilisation de machines ou d\'instruments dangereux, la conduite automobile sont déconseillées pendant une période limitée qui sera définie par votre ophtalmologiste.</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">• Dans plus de 30 % des cas, il se produit, au cours des années qui suivent l\'intervention, une opacification de la capsule : c\'est la &quot;cataracte secondaire&quot; responsable d\'une nouvelle baisse de vision. Le traitement consiste à réaliser une ouverture de la capsule par laser ou par chirurgie.</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">Les complications de l\'opération de la cataracte.</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Bien qu\'elle soit parfaitement standardisée et suivie d\'excellents résultats, l\'opération de la cataracte n\'échappe pas à la règle générale selon laquelle il n\'existe pas de chirurgie sans risque. Il n\'est donc pas possible à votre ophtalmologiste de garantir formellement le succès de l\'intervention.</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">• Les complications sévères de l\'opération de la cataracte sont très rares. Elle peuvent nécessiter une réintervention et aboutir, dans les cas les plus extrêmes, à la perte de toute vision de l\'oeil opéré, voire à la perte de l\'oeil lui-même. Il s\'agit</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">• des infections (1 à 3 cas sur 1000)</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">• du traumatisme de l\'oeil par le patient ou son entourage</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">• du décollement de la rétine (1 cas sur 100)</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">• du trouble de la cornée</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">• de l\'extraction incomplète de la cataracte</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">• du déplacement du cristallin artificiel</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">• d\'un oedème rétinien central</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">• d\'une brûlure rétinienne par l\'éclairage du microscope opératoire.</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">• D\'autres complications sont moins sévères, comme</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">• la cicatrice insuffisamment étanche</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">• une chute partielle de la paupière supérieure</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">• un hématome du blanc de l\'oeil ou de la paupière</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">• la perception de mouches volantes</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">• une sensibilité accrue à la lumière</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">• une inflammation de l\'oeil</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">• l\'augmentation de la pression intra-oculaire</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">• la déformation de la cornée (astigmatisme)</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">• une vision dédoublée.</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">• L\'erreur de calcul de la puissance du cristallin artificiel est rare, comte tenu de la précision de l\'échographie systématiquement réalisée avant l\'intervention. Elle peut éventuellement nécessiter une réintervention.</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Votre ophtalmologiste est disposé à répondre à toute question complémentaire que vous souhaiteriez lui poser.</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Les dispositions réglementaires font obligation au médecin de prouver qu\'il a fourni l\'information au patient. Aussi vous demande-t-on de signer ce document dont le double est conservé par votre médecin.</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Je soussigné <span style=\" font-weight:600;\">{{PRENOM PATIENT}} {{NOM PATIENT}},</span> reconnais que la nature de l\'examen ou de l\'intervention, ainsi que ses risques, m\'ont été expliqués en termes que j\'ai compris, et qu\'il a été répondu de façon satisfaisante à toutes les questions que j\'ai posées.</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">J\'ai disposé d\'un délai de réflexion suffisant et:</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">. donne mon accord</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">. ne donne pas mon accord</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">pour la réalisation de l\'acte qui m\'est proposé.</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Date et Signature</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p></body></html>','Consentement éclairé cataracte',NULL,1,1,NULL,NULL,NULL),
(13,_binary '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0//EN\" \"http://www.w3.org/TR/REC-html40/strict.dtd\">\n<html><head><meta name=\"qrichtext\" content=\"1\" /><style type=\"text/css\">\np, li { white-space: pre-wrap; }\n</style></head><body style=\" font-family:\'Comic Sans MS\'; font-size:13pt; font-weight:400; font-style:normal;\">\n<p align=\"right\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">{{CORRESPONDANT PATIENT}},</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">{{FORMULE POLITESSE CORRESPONDANT}},</p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Je vois aujourd\'hui {{TITRE PATIENT}} <span style=\" font-weight:600;\">{{PRENOM PATIENT}} {{NOM PATIENT}}</span>, né(e) le {{DDN}}, dans le cadre de la surveillance de son diabète.</p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Son fond d\'oeil ne montre pas de signe de rétinopathie diabétique et je ne pense pas qu\'il soit utile de lui faire passer une angiographie pour le moment.</p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Amitiés.</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p></body></html>','Bilan de diabète',NULL,1,1,NULL,1,1),
(14,_binary '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0//EN\" \"http://www.w3.org/TR/REC-html40/strict.dtd\">\n<html><head><meta name=\"qrichtext\" content=\"1\" /><style type=\"text/css\">\np, li { white-space: pre-wrap; }\n</style></head><body style=\" font-family:\'Comic Sans MS\'; font-size:13pt; font-weight:400; font-style:normal;\">\n<p align=\"center\" style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; background-color:#ffffff;\"><span style=\" font-size:24pt;\">Opération du glaucome chronique </span></p>\n<p align=\"center\" style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; background-color:#ffffff;\"><span style=\" font-size:24pt;\">Chirurgie filtrante</span><span style=\" font-size:24pt; font-weight:696; color:#0033ff;\"> </span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt;\">{{TITRE PATIENT}} {{PRENOM PATIENT}} {{NOM PATIENT}}, </span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt;\">Vous présentez un glaucome chronique qui menace votre vision. Votre ophtalmologiste vous propose l\'opération, car la chirurgie représente, à ce stade, </span><span style=\" font-size:14pt; font-weight:696;\">le moyen le plus approprié pour tenter de stabiliser l\'état de votre vision.</span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt;\">Cette fiche contient l\'information sur l\'opération qui vous est proposée, sur ses résultats et sur ses risques.<br />___________________________ </span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:18pt; font-weight:696; color:#0033ff;\">Le glaucome chronique </span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt;\">Cette maladie de l\'oeil atrophie progressivement le nerf optique. Elle détériore insidieusement le champ visuel avec menace de cécite. </span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt;\">Parmi ses multiples causes, la plus fréquente et la plus importante est l\'existence d\'une pression trop élevée dans l\'oeil. </span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt;\">Seul votre ophtalmologiste est qualifié pour évaluer la nocivité ou non du niveau de cette pression en tenant compte des autres données de l\'examen de votre oeil : état du nerf optique et du champ visuel en particulier. </span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:18pt; font-weight:696; color:#0033ff;\">Pourquoi opérer le glaucome chronique? </span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt;\">Il existe 3 méthodes pour abaisser la pression : les collyres, le laser et la chirurgie. Votre ophtalmologiste vous propose celle qu\'il estime la plus apte à préserver le plus longtemps possible votre vision. </span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:18pt; font-weight:696; color:#0033ff;\">La chirurgie filtrante du glaucome chronique </span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt;\">L\'intervention est réalisée alors que le patient est installé sur le dos, en milieu chirurgical stérile et sous microscope. Elle représente un geste chirurgical majeur, car elle consiste à inciser l\'oeil pour en abaisser la pression. </span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; background-color:#ffffff;\"><span style=\" font-size:14pt; font-weight:696;\">Hospitalisation </span><span style=\" font-size:14pt;\">: Une immobilisation minimale de quelques heures est nécessaire. Le mode d\'hospitalisation adapté à votre cas vous sera proposé par votre ophtalmologiste en accord avec l\'anesthésiste. </span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt; font-weight:696;\">Anesthésie </span><span style=\" font-size:14pt;\">: L\'oeil peut être insensibilisé par des injections de voisinage, ou uniquement par l\'instillation de gouttes. Une anesthésie générale est également possible.<br />Le choix résulte de l\'avis de votre ophtalmologiste et de celui du médecin anesthésiste. Il prend en compte, si possible, votre souhait. </span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt; font-weight:696;\">L\'intervention filtrante </span><span style=\" font-size:14pt;\">consiste à réaliser une soupape avec les tissus de l\'oeil. Dans certains cas peuvent être associés des moyens mécaniques ou chimiques facilitant la filtration. Ces incisions sont refermées par des points de suture.<br />Il peut être nécessaire d\'enlever un petit fragment de l\'iris ou de procéder à l\'ablation d\'une partie du vitré. </span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt; font-weight:696;\">Incidents ou difficultés peropératoires </span><span style=\" font-size:14pt;\">: ils sont rares et imprévisibles et peuvent conduire à renoncer à l\'intervention. Il s\'agit essentiellement d\'hémorragies, qui en général se résorbent en quelques jours, mais peuvent aboutir à la perte de toute vision, voire à la perte de l\'oeil dans des cas très exceptionnels. </span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:18pt; font-weight:696; color:#0033ff;\">Evolution postopératoire habituelle </span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt;\">Dans la grande majorité des cas (75 %), la pression est abaissée à un niveau normal. Il se forme généralement une grosseur sous la paupière supérieure. Dans 25 % des cas, il peut être nécessaire de reprendre 1\'utilisation de collyres antiglaucomateux, voire de recourir à une nouvelle intervention. Un certain degré d\'irritation oculaire peut accompagner la résorption des fils de suture durant quelques semaines après l\'intervention. Il est parfois nécessaire de procéder à l\'ablation de fils de suture. Une accentuation momentanée des difficultés visuelles est habituellement ressentie ainsi qu\'un larmoiement. </span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt;\">Les soins locaux sont réduits à l\'instillation de gouttes, à l\'application d\'une pommade et au port d\'une protection oculaire selon des modalités et durant une période qui vous seront précisées par votre chirurgien. L\'activité professionnelle, 1\'utilisation de machines ou d\'instruments dangereux, la conduite automobile sont déconseillées pendant une période limitée qui sera définie par votre chirurgien. </span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt;\">La normalisation de la pression par la chirurgie filtrante constitue un moyen efficace de ralentir, voire de supprimer le processus d\'atrophie du nerf optique. L\'évolution du glaucome peut cependant se poursuivre si d\'autres facteurs, en particulier circulatoires, interviennent. </span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt; font-weight:696;\">La chirurgie filtrante du glaucome a comme objectif d\'abaisser la pression de l\'oeil. Elle ne peut en aucun cas prétendre améliorer l\'état de la vision. </span></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<table border=\"0\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px;\" cellspacing=\"2\" cellpadding=\"0\" bgcolor=\"#ffffff\">\n<tr>\n<td>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:18pt; font-weight:696; color:#0033ff;\">Les complications de la chirurgie filtrante du glaucome chronique </span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt;\">Les complications sévères de cette chirurgie sont exceptionnelles et il n\'est pas possible de les chiffrer. Elles peuvent nécessiter une réintervention et aboutir, dans les cas les plus extrêmes, à la perte de toute vision de l\'oeil opéré, voire à la perte de l\'oeil lui-même. il s\'agit<br />. des </span><span style=\" font-size:14pt; font-weight:696;\">infections<br />. </span><span style=\" font-size:14pt;\">du </span><span style=\" font-size:14pt; font-weight:696;\">traumatisme </span><span style=\" font-size:14pt;\">de l\'oeil par le patient ou son entourage<br />. d\'une </span><span style=\" font-size:14pt; font-weight:696;\">hyperpression </span><span style=\" font-size:14pt;\">qui peut nécessiter une réintervention en urgence. </span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt;\">D\'autres complications sont moins sévères, comme une filtration trop importante<br />. la trop forte réduction prolongée de la pression<br />. un larmoiement excessif<br />. l\'inflammation de l\'oeil<br />. des douleurs liées à la filtration<br />. l\'apparition ou l\'aggravation d\'une cataracte. </span></p></td></tr>\n<tr>\n<td bgcolor=\"#ffffdc\">\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt; font-weight:696; color:#0033ff;\">Votre ophtalmologiste est disposé à répondre à toute question complémentaire que vous souhaiteriez lui poser. </span></p></td></tr>\n<tr>\n<td></td></tr>\n<tr>\n<td bgcolor=\"#fbffe8\">\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt;\">Les dispositions réglementaires font obligation au médecin de prouver qu\'il a fourni l\'information au patient. Aussi vous demande-t-on de signer ce document dont le double est conservé par votre médecin. </span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt;\">Je soussigné {{PRENOM PATIENT}} {{NOM PATIENT}} reconnais que la nature de l\'examen ou de l\'intervention, ainsi que ses risques, m\'ont été expliqués en termes que j\'ai compris, et qu\'il a été répondu de façon satisfaisante à toutes les questions que j\'ai posées. </span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt;\">J\'ai disposé d\'un délai de réflexion suffisant et<br />. donne mon accord<br />. ne donne pas mon accord<br />pour la réalisation de l\'acte qui m\'est proposé.</span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:12pt; font-weight:696;\">Date et Signature</span><span style=\" font-size:10pt; font-weight:696; font-style:italic;\">: </span></p></td></tr>\n<tr>\n<td></td></tr></table></body></html>','Consentement éclairé glaucome',NULL,1,1,NULL,NULL,NULL),
(15,_binary '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0//EN\" \"http://www.w3.org/TR/REC-html40/strict.dtd\">\n<html><head><meta name=\"qrichtext\" content=\"1\" /><style type=\"text/css\">\np, li { white-space: pre-wrap; }\n</style></head><body style=\" font-family:\'Comic Sans MS\'; font-size:13pt; font-weight:400; font-style:normal;\">\n<p align=\"center\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:18pt; font-weight:600;\">Techniques de chirurgie réfractive</span></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'Times\'; font-size:14pt;\"><br /></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'Times\'; font-size:14pt;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">{{TITRE PATIENT}} {{PRENOM PATIENT}} {{NOM PATIENT}}, </span></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'Times\'; font-size:14pt;\"><br /></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'Times\'; font-size:14pt;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">Vous présentez une anomalie de la réfraction. Ce document est destiné à vous fournir les principaux éléments nécessaires pour comprendre le principe et les effets des différentes techniques opératoires.</span></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'Times\'; font-size:14pt;\"><br /></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'Times\'; font-size:14pt;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">Les anomalies de la réfraction</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">Dans un œil normal, le trajet des rayons lumineux est modifié par la cornée et le cristallin pour leur permettre de converger sur la rétine. L\'œil myope est un œil trop long, les rayons lumineux convergent en avant de la rétine. L\'œil hypermétrope est trop court et les rayons lumineux convergent en arrière de la rétine. L\'œil astigmate présente des anomalies de courbure cornéenne. Les différents moyens de correction(lunettes, lentilles de contact et techniques de chirurgie réfractive) ont pour but de modifier le trajet des rayons lumineux.</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">Plusieurs techniques chirurgicales peuvent être proposées. La méthode la plus adaptée à votre cas particulier sera choisie avec votre chirurgien, ainsi que le mode d’anesthésie.</span></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'Times\'; font-size:14pt;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">La chirurgie au laser excimer</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">La chirurgie au laser excimer a pour principe de modifier la forme de la cornée en réalisant une ablation localisée de tissu cornéen. Elle est destinée à corriger myopie, hypermétropie et astigmatisme. Cette propriété est utilisée de deux façons :</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">1 Le laser excimer de surface (Photokératectomie réfractive) </p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">L\'opération se pratique sous anesthésie locale. Après un pelage de la couche superficielle, les impacts de laser sont appliqués sur la surface de la cornée. Sa durée est courte (quelques minutes).</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">Son principal avantage est la sécurité.</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">Les inconvénients résident dans les phénomènes douloureux qui peuvent exister pendant quelques jours.</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">Dans certains cas, il peut survenir un voile cicatriciel susceptible de retarder la récupération visuelle. Ce voile est le plus souvent minime, mais dans de rares cas, il peut être assez dense pour gêner la vision pendant plusieurs mois.</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">En cas de correction insuffisante, une nouvelle intervention est possible dans un délai minimum d’un an.</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">2 Le laser intrastromal (Lasik)</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">Dans cette méthode, le laser est appliqué dans l’épaisseur de la cornée après découpe chirurgicale d’un volet de tissu cornéen remis en place en fin d’intervention. Cette technique, réalisée sous anesthésie locale, est peu douloureuse. La récupération visuelle est rapide.</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">En cas de correction imparfaite, il est généralement possible de compléter le traitement.</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">Le principal inconvénient réside dans la découpe du volet cornéen qui peut induire des complications spécifiques (altérations de forme et de transparence de la cornée).</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">3 Particularités des techniques utilisant le laser excimer</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">Après toute chirurgie au laser excimer, le port de verres filtrant les ultraviolets est nécessaire pendant plusieurs mois en cas d’exposition solaire.</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">Le laser excimer est utilisé depuis quelques années. Ses effets à très long terme ne sont pas encore connus.</span></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">Technique d’incision cornéenne</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">La pratique d’incisions profondes dans la cornée permet également de modifier sa forme. Lorsqu’elles sont disposées de façon radiaire périphérique (technique nommée kératotomie radiaire), elles permettent de corriger la myopie faible et moyenne. La stabilité de la correction n’est cependant pas assurée , car l’évolution à long terme peut se faire vers l’hypermétropie.</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">Des incisions transverses ou arciformes peuvent corriger l’astigmatisme.</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">Technique des anneaux intracornéens</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">L’insertion de segments d’anneaux synthétiques dans l’épaisseur de la cornée périphérique permet de modifier la forme de la cornée. Son principal avantage théorique est la réversibilité. Cette technique est récente. Le recul est insuffisant pour apprécier sa tolérance à long terme et pour juger de la stabilité de la correction.</span></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">Technique des implants intraoculaires</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">Ces techniques chirurgicales nécessitent l’ouverture de l’œil, ce qui peut induire des complications au niveau des différents tissus. Elles consistent à mettre en place des implants synthétiques qui sont des lentilles réfractives permettant de modifier le trajet des rayons lumineux, sans modifier la forme de la cornée. Ces techniques sont réservées à la correction des fortes myopies et des fortes hypermétropies. Les implants peuvent être placés en avant du cristallin ou après son extraction.</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">Lorsque le cristallin est extrait, la capacité de mise au point entre vision de loin et vision de près (mécanisme de l’accommodation) est perdue et doit être compensée par des lunettes. Cette chirurgie s’adresse en général à des patients de plus de 40 ans.</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">La mise en place d’un implant dans un œil qui conserve son cristallin préserve le mécanisme de l’accommodation. Elle expose à certaines complications spécifiques au niveau de la cornée et du cristallin qui imposent une surveillance systématique régulière à long terme. En cas d’intolérance, ces implants peuvent être retirés.</span></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">Les risques communs à toutes les techniques de chirurgie réfractive</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">Le résultat recherché ne peut jamais être garanti, car il dépend des phénomènes de cicatrisation avec des variations individuelles. Une correction complémentaire par lunettes, lentilles de contact ou par réintervention est parfois nécessaire.</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">Les règlements concernant les aptitudes visuelles des professions sont continuellement modifiés. Il est donc indispensable que vous vérifiez vous-même auprès des administrations concernées si une intervention de chirurgie réfractive est acceptée (armée, police, gendarmerie, marine, pompiers, SNCF, transport aérien ou routier, etc…).</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">Les opérations de chirurgie réfractive n’échappent pas à la règle générale selon laquelle il n’y a pas de chirurgie sans risque. Même si celui-ci est très faible, des complications allant des plus anodines aux plus graves sont possibles.</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">Parmi les conséquences possibles de ces complications, on peut citer la perception de halos, une tendance à l’éblouissement, une réduction de l’acuité visuelle même avec correction, une gêne à la vision nocturne, une vision dédoublée, une déformation des images, un abaissement de la paupière supérieure. Ces complications transitoires ou définitives peuvent parfois nécessiter un traitement médical ou chirurgical.</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">Dans des cas exceptionnels, comme pour toute chirurgie oculaire, les complications peuvent prendre un caractère de gravité conduisant à la perte de la vision, voire à la perte de l’œil. Cette éventualité est tellement exceptionnelle que sa fréquence est impossible à évaluer.</span></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'Times\'; font-size:14pt;\"><br /></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'Times\'; font-size:14pt;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">Votre ophtalmologiste est disposé à répondre à toute question complémentaire que vous souhaiteriez lui poser.</span></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'Times\'; font-size:14pt;\"><br /></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'Times\'; font-size:14pt;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">Les dispositions réglementaires font obligation au médecin de prouver qu’il a fourni l’information au patient. Aussi vous demande-t-on de signer ce document dont le double est conservé par votre médecin.</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">Je soussigné {{PRENOM PATIENT}} {{NOM PATIENT}}, reconnais que la nature de l’examen ou de l’intervention, ainsi que ses risques, m’ont été expliqués en termes que j’ai compris, et qu’il a été répondu de façon satisfaisante à toutes les questions que j’ai posées.</span></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'Times\'; font-size:14pt;\"><br /></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'Times\'; font-size:14pt;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">J’ai disposé d’un délai de réflexion suffisant et</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\"> donne mon accord</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\"> ne donne pas mon accord</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">pour la réalisation de l’acte qui m’est proposé.</span></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'Times\'; font-size:14pt;\"><br /></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'Times\'; font-size:14pt;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times\'; font-size:14pt;\">Date et signature :</span></p></body></html>','Consentement éclairé réfractive',NULL,1,1,NULL,NULL,NULL),
(16,_binary '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0//EN\" \"http://www.w3.org/TR/REC-html40/strict.dtd\">\n<html><head><meta name=\"qrichtext\" content=\"1\" /><style type=\"text/css\">\np, li { white-space: pre-wrap; }\n</style></head><body style=\" font-family:\'Comic Sans MS\'; font-size:13pt; font-weight:400; font-style:normal;\">\n<p align=\"center\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Chalkboard,13,-1,5,50,0,0,0,0,0\'; font-size:14pt;\">CERTIFICAT DE PASSAGE</span></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'Chalkboard,13,-1,5,50,0,0,0,0,0\'; font-size:14pt;\"><br /></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'Chalkboard,13,-1,5,50,0,0,0,0,0\'; font-size:14pt;\"><br /></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'Chalkboard,13,-1,5,50,0,0,0,0,0\'; font-size:14pt;\"><br /></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'Chalkboard,13,-1,5,50,0,0,0,0,0\'; font-size:14pt;\"><br /></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'Chalkboard,13,-1,5,50,0,0,0,0,0\'; font-size:14pt;\"><br /></p>\n<p align=\"justify\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Chalkboard,13,-1,5,50,0,0,0,0,0\'; font-size:14pt;\">Je soussigné, {{TITREUSER}}, certifie avoir vu en consultation à mon cabinet, {{TITRE PATIENT}} {{PRENOM PATIENT}} {{NOM PATIENT}}, né(e) le {{DDN}}, le {{DATE}} à </span>((Heure de passage//HEURE))<span style=\" font-family:\'Chalkboard,13,-1,5,50,0,0,0,0,0\'; font-size:14pt;\">.</span></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'Chalkboard,13,-1,5,50,0,0,0,0,0\'; font-size:14pt;\"><br /></p></body></html>','Certificat de passage',NULL,1,1,NULL,1,NULL),
(17,_binary '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0//EN\" \"http://www.w3.org/TR/REC-html40/strict.dtd\">\n<html><head><meta name=\"qrichtext\" content=\"1\" /><style type=\"text/css\">\np, li { white-space: pre-wrap; }\n</style></head><body style=\" font-family:\'Comic Sans MS\'; font-size:13pt; font-weight:400; font-style:normal;\">\n<p align=\"center\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">Intervention de cataracte de ((Côté de l\'intervention//COTEINTERVENTION)) du ((Date d\'intervention//DATEINTERVENTION))</span></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">{{TITRE PATIENT}} {{PRENOM PATIENT}} {{NOM PATIENT}},</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">La date de votre intervention à la clinique de Marignane est fixée au ((Date d\'intervention//DATEINTERVENTION)).</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Il faudra vous présenter à l\'accueil de la clinique à ((Heure d\'intervention//HEUREINTERVENTION)), à jeun.</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Auparavant, vous devez effectuer un bilan préopératoire (biométrie oculaire, examen du fond d’œil) à mon cabinet, une dizaine de jours avant l’intervention. Il vous faut aussi prendre rendez-vous pour une consultation d’anesthésie à la clinique de Marignane (tél 0442784500).</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">N\'hésitez pas à me téléphoner si vous souhaitez avoir des explications supplémentaires.</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Enfin, il vous faudra lire et me rendre signée, quelques jours avant l’intervention, la notice d’information de 3 pages sur la chirurgie de la cataracte.</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Avec mes remerciements.</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p></body></html>','Courrier préopératoire cataracte',NULL,1,1,NULL,NULL,1),
