(50,_binary '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0//EN\" \"http://www.w3.org/TR/REC-html40/strict.dtd\">\n<html><head><meta name=\"qrichtext\" content=\"1\" /><style type=\"text/css\">\np, li { white-space: pre-wrap; }\n</style></head><body style=\" font-family:\'Comic Sans MS\'; font-size:13pt; font-weight:400; font-style:normal;\">\n<p align=\"right\" style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">{{TITRE PATIENT}} {{PRENOM PATIENT}} {{NOM PATIENT}}</span><br /><span style=\" text-decoration: underline;\">AGE :</span> {{AGE PATIENT}}</p>\n<p style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">Lieu : ((Lieu d\'intervention//SITEINTERVENTION))</span></p>\n<p align=\"center\" style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:16pt; font-weight:600; text-decoration: underline;\">Intervention de cataracte de ((Côté de l\'intervention//COTEINTERVENTION)) du ((Date d\'intervention//DATEINTERVENTION))</span></p>\n<p style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Anesthésie ((Type d\'anesthésie//ANESTHINTERVENTION))</p>\n<p style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Nettoyage des culs de sac conjonctivaux et champ opératoire par Betadine ophtalmique</p>\n<p style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Mise en place du champ opératoire, du blepharostat et nouveau nettoyage des culs de sacs conjonctivaux par Betadine ophtalmique</p>\n<p style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">In