decoration: underline;\">ANGIOGRAPHIE EN FLUORESCENCE DU ((Date de l\'examen//DATE))</span></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; text-decoration: underline;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">CLICHÉS AVANT INJECTION ET SÉQUENCES ANGIOGRAPHIQUES:</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" text-decoration: underline;\">ŒIL DROIT:</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Microanévrysmes et microhémorragies au pôle postérieur avec de discrètes diffusions de colorant au cours de la séquence. La maille anastomotique est rompue. Oedème maculaire diffus très discret aux temps tardifs. </p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Absence de territoires ischémiques non photocoagulés en périphérie. </p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Absence de signe de neovascularisation prérétinienne en périphérie.</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" text-decoration: underline;\">ŒIL GAUCHE:</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Microanévrysmes et microhémorragies au pôle postérieur avec de discrètes diffusions de colorant au cours de la séquence. La maille anastomotique est rompue. Oedème maculaire diffus très discret aux temps tardifs. </p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Absence de territoires ischémiques non photocoagulés en périphérie. </p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Absence de signe de neovascularisation prérétinienne en périphérie</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" text-decoration: underline;\">CONCLUSION:</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Rétinopathie diabétique panphotocoagulée avec maculopathie mixte, d\'aspect stable par rapport à l\'examen précédent.</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p></body></html>','Compte rendu angiographie',NULL,1,NULL,NULL,1,1),
