; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times New Roman\'; font-weight:600; font-style:italic;\">		COÛT TOTAL pour les 2 yeux</span><span style=\" font-family:\'Times New Roman\'; font-style:italic;\">		</span><span style=\" font-family:\'Times New Roman\'; font-weight:600; font-style:italic;\">4 000 €</span></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'Times New Roman\';\"><br /></p></body></html>','Devis PRELEX',NULL,1,1,NULL,1,0),
(126,_binary '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0//EN\" \"http://www.w3.org/TR/REC-html40/strict.dtd\">\n<html><head><meta name=\"qrichtext\" content=\"1\" /><style type=\"text/css\">\np, li { white-space: pre-wrap; }\n</style></head><body style=\" font-family:\'Comic Sans MS\'; font-size:13pt; font-weight:400; font-style:normal;\">\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">faire pratiquer radio crâne F + P + NFP</p></body></html>','Radio crâne',NULL,1,1,1,NULL,1),
(127,_binary '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0//EN\" \"http://www.w3.org/TR/REC-html40/strict.dtd\">\n<html><head><meta name=\"qrichtext\" content=\"1\" /><style type=\"text/css\">\np, li { white-space: pre-wrap; }\n</style></head><body style=\" font-family:\'Comic Sans MS\'; font-size:13pt; font-weight:400; font-style:normal;\">\n<p align=\"center\" style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Chirurgie du cristallin à visée réfractive</p>\n<p align=\"center\" style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /><span style=\" font-weight:600;\">Intervention de chirurgie du cristallin de ((Côté à opérer//COTE)) du ((Date d\'intervention//DATE))</span></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">{{TITRE PATIENT}} {{PRENOM PATIENT}} {{NOM PATIENT}},</span></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Vous présentez une anomalie de la réfraction que votre ophtalmologiste vous propose de traiter par une extraction du cristallin et son remplacement par un implant de puissance adaptée. Cette fiche contient l\'information sur l\'opération qui vous est proposée, sur ses résultats et sur ses risques. </p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">Le cristallin </span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Il s\'agit d\'une lentille de forte puissance, située à l\'intérieur de l\'œil, jouant un rôle important dans la vision et l’accommodation, c’est-à-dire le passage de la vision de loin à la vision de près. C’est l’objectif et le focus d\'un appareil photographique. </p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Pourquoi opérer ? </p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Cette opération consiste à remplacer le cristallin naturel par un cristallin artificiel, ou implant de puissance adaptée qui permet de modifier le trajet des rayons lumineux pour réduire ou annuler le port d’une correction optique. Elle peut être proposée pour la correction de tous les défauts de la réfraction : myopie, hypermétropie, astigmatisme : un implant torique est alors souvent nécessaire, et enfin presbytie : un implant multifocal ou accommodatif représente la solution la plus fréquente alors. </p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">L\'opération sur le cristallin :</span> </p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">L\'intervention est réalisée alors que le patient est installé sur le dos, en milieu chirurgical stérile et sous microscope. Elle représente un geste chirurgical majeur, car elle consiste à inciser l\'œil et à en extraire l\'un de ses éléments internes, le cristallin, lentille dont l’opacification est appelée cataracte. </p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">Hospitalisation :</span> </p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Une immobilisation minimale appropriée est nécessaire. Le mode d\'hospitalisation adapté à votre cas vous sera proposé par votre ophtalmologiste </p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">Anesthésie : </span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">L\'œil est insensibilisé uniquement par l\'instillation de gouttes ou éventuellement par des injections autour de l’œil. Une anesthésie générale est également possible. Le choix de l\'anesthésie est décidé entre l\'anesthésiste et l\'ophtalmologiste qui tiennent aussi compte de vos souhaits </p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">L’intervention : </span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Le chirurgien a recours à l’instrumentation qui lui semble la mieux adaptée. L\'extraction du cristallin est réalisée par une sonde passant par une petite incision et peut-être assistée par laser. Le sac contenant le cristallin (la capsule) est laissé en place. Il est exceptionnel de procéder à l\'extraction de l’ensemble du cristallin et de la capsule. </p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">Implantation d\'un cristallin artificiel (implant intraoculaire) : </span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Le cristallin est remplacé par une lentille synthétique placée derrière la pupille. L\'incision de l\'œil est suturée ou non. </p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">Incidents ou difficultés peropératoires :</span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Ils sont rares et imprévisibles mais peuvent modifier le déroulement de l’intervention. La principale complication est la rupture de la capsule (moins de 5% des cas). Elle conduit parfois à placer l\'implant devant la pupille, voire à renoncer à toute implantation. Il peut être nécessaire d\'enlever un petit fragment de l\'iris et/ou de procéder à l\'ablation d\'une partie du vitré dans le même temps ou dans un second temps. L\'extraction de la cataracte est parfois incomplète et peut imposer une reprise chirurgicale. </p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">Les implants intraoculaires disponibles :</span> </p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Le choix, discuté avec votre chirurgien, sera fondé sur les caractéristiques fonctionnelles et anatomiques de vos yeux, ainsi que sur vos besoins visuels. Les différentes catégories se rangent entre : - monofocaux : calculés pour corriger la vision à une distance donnée </p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">- toriques : capables d\'ajouter la correction d\'un astigmatisme existant avant l\'opération - multifocaux : visant à corriger la vision aux différentes distances élémentaires, ou accommodatifs : </p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">visant à restaurer la vision de loin et intermédiaire ; ces deux concepts étant destinés à réduire la dépendance aux lunettes. </p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Dans votre cas, il sera posé un implant dont le but est de donner une vision de loin et une vision intermédiaire (à 80 centimètres de distance) confortables mais qui ne permettra probablement pas une vision de près parfaite, nécessitant alors une paire de verres correcteurs pour la vision à moins de 80 centimètres.</p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">L\'évolution post-opératoire habituelle : </span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Dans la très grande majorité des cas (95%), l\'œil opéré du cristallin est indolore. La vision s\'améliore très rapidement et une correction adaptée par lunettes peut être prescrite au bout de quelques semaines. La présence d\'autres lésions de l\'œil (glaucome, rétine...cicatrices ou maladie cornéenne) peut limiter la récupération visuelle. </p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Les soins locaux sont réduits à l\'instillation de gouttes, à l\'application d\'une pommade et au port d\'une protection oculaire selon des modalités et durant une période qui vous seront précisées par votre chirurgien. Il est parfois nécessaire de procéder à l\'ablation de fils de suture. L\'activité professionnelle, l\'utilisation de machines ou d\'instruments dangereux, la conduite automobile sont déconseillées pendant une période limitée qui sera définie par votre ophtalmologiste. </p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Dans plus de 30 % des cas, il se produit, au cours des années qui suivent l\'intervention, une opacification de la capsule: c\'est la &quot;cataracte secondaire&quot; responsable d\'une nouvelle baisse de vision. Le traitement consiste à réaliser une ouverture de la capsule par laser ou par chirurgie. Une sécheresse oculaire plus ou moins durable peut survenir, se traduisant par une gêne oculaire à type de sensation de corps étranger, picotements, brûlure, larmoiement réflexe paradoxal. La perception de mouches volantes est aussi possible. </p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">Les complications post-opératoires de l\'opération sur le cristallin : </span></p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Bien qu\'elle soit parfaitement standardisée et suivie d\'excellents résultats, l\'opération sur le cristallin n\'échappe pas à la règle générale selon laquelle il n\'existe pas de chirurgie sans risque. Il n\'est donc pas possible à votre ophtalmologiste de garantir formellement le succès de l\'intervention. Les complications sévères de l\'opération sur le cristallin sont très rares. Elles peuvent nécessiter une ré-intervention et aboutir, dans les cas les plus extrêmes, à la perte de toute vision de l\'œil opéré, voire à la perte de l\'œil lui-même. Il s\'agit des infections (moins de 1 cas sur 1000), du traumatisme de l\'œil par le patient ou son entourage, du décollement de la rétine, du trouble de la cornée, de déformation pupillaire, de l\'extraction incomplète de la cataracte, du déplacement du cristallin artificiel, d\'un œdème rétinien maculaire. Enfin l’hémorragie est une complication grave rarissime. D\'autres complications sont moins sévères, comme la cicatrice insuffisamment étanche, une chute partielle de la paupière supérieure, un hématome du blanc de l\'œil ou de la paupière, une sensibilité accrue à la lumière, une inflammation de l\'œil, l\'augmentation de la pression intraoculaire, la déformation de la cornée (astigmatisme), une vision dédoublée. L\'erreur de calcul de la puissance du cristallin artificiel est rare, compte tenu de la précision des systèmes de mesures utilisés systématiquement avant l\'intervention. Elle peut éventuellement nécessiter une ré-intervention. </p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Je soussigné <span style=\" font-weight:600;\">{{PRENOM PATIENT}} {{NOM PATIENT}}</span>, reconnais que la nature de l\'examen ou de l\'intervention, ainsi que ses risques, m\'ont été expliqués en termes que j\'ai compris, et qu\'il a été répondu de façon satisfaisante à toutes les questions que j\'ai posées.</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">J\'ai disposé d\'un délai de réflexion suffisant et:</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">. donne mon accord</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">. ne donne pas mon accord</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">pour la réalisation de l\'acte qui m\'est proposé.</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Date et Signature</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p></body></html>','Consentement éclairé Prelex',NULL,1,1,NULL,1,NULL),
(128,_binary '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0//EN\" \"http://www.w3.org/TR/REC-html40/strict.dtd\">\n<html><head><meta name=\"qrichtext\" content=\"1\" /><style type=\"text/css\">\np, li { white-space: pre-wrap; }\n</style></head><body style=\" font-family:\'Comic Sans MS\'; font-size:13pt; font-weight:400; font-style:normal;\">\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:14pt; font-weight:600;\">Intervention de chirurgie de cristallin à visée réfractive de ((Côté à opérer//COTE)) du ((Date d\'intervention//DATE))</span></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">{{TITRE PATIENT}} {{PRENOM PATIENT}} {{NOM PATIENT}},</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">La date de votre intervention à ((Lieu d\'intervention//SITEINTERVENTION)) est fixée au ((Date d\'intervention//DATE)).</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Il faudra vous présenter à l\'accueil à ((Heure d\'intervention//HEURE)), à jeun.</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Auparavant, vous devez effectuer un bilan préopératoire (biométrie oculaire, examen du fond d’œil) à mon cabinet, une dizaine de jours avant l’intervention. Il vous faut aussi prendre rendez-vous pour une consultation d’anesthésie à la clinique de Marignane (tél 0442784500).</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">N\'hésitez pas à me téléphoner si vous souhaitez avoir des explications supplémentaires.</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Enfin, il vous faudra lire et me rendre signée, quelques jours avant l’intervention, la notice d’information de 3 pages sur la chirurgie de la cataracte.</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Avec mes remerciements.</p></body></html>','Courrier préopératoire Prelex',NULL,1,1,NULL,1,NULL),
(129,_binary '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0//EN\" \"http://www.w3.org/TR/REC-html40/strict.dtd\">\n<html><head><meta name=\"qrichtext\" content=\"1\" /><style type=\"text/css\">\np, li { white-space: pre-wrap; }\n</style></head><body style=\" font-family:\'Comic Sans MS\'; font-size:13pt; font-weight:400; font-style:normal;\">\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Je, soussigné {{TITREUSER}}, certifie que {{TITRE PATIENT}} {{PRENOM PATIENT}} {{NOM PATIENT}} a été opéré de sont trouble de la vision et présente aujourd\'hui une acuité visuelle de 10/10 P2 à chaque oeil sans correction.</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Il n\'a donc plus besoin de verrres correcteurs pour la conduite automobile.</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Certificat fait à la demande de l\'intéressé(e) et remis en main propre pour servir et valoir ce que de droit.</p></body></html>','Certificat acuité post chirurgie réfractive',NULL,1,1,NULL,1,NULL),
