(136,_binary '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0//EN\" \"http://www.w3.org/TR/REC-html40/strict.dtd\">\n<html><head><meta name=\"qrichtext\" content=\"1\" /><style type=\"text/css\">\np, li { white-space: pre-wrap; }\n</style></head><body style=\" font-family:\'Comic Sans MS\'; font-size:13pt; font-weight:400; font-style:normal;\">\n<p align=\"right\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">{{TITRE PATIENT}} {{PRENOM PATIENT}} {{NOM PATIENT}}</span><br /><span style=\" text-decoration: underline;\">AGE :</span> {{AGE PATIENT}}</p>\n<p align=\"center\" style=\"-qt-paragraph-type:empty; margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p align=\"center\" style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:16pt; text-decoration: underline;\">Intervention de cataracte de ((Côté//COTE)) du ((Date intervention//DATE))</span></p>\n<p style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Anesthésie ((Type anesthésie//TEXTE))</p>\n<p style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Nettoyage des culs de sac conjonctivaux et champ opératoire par Betadine ophtalmique</p>\n<p style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Mise en place du champ opératoire, du blepharostat et nouveau nettoyage des culs de sacs conjonctivaux par Betadine ophtalmique</p>\n<p style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Incision cornéenne 2,2mm</p>\n<p style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Capsulorexhis </p>\n<p style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Hydrodissection et phakoemulsification du noyau</p>\n<p style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Lavage des masses</p>\n<p style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Implantation dans le sac capsulaire</p>\n<p style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Lavage du visqueux</p>\n<p style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Hydrosuture et injection Aprokam en chambre antérieure</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p></body></html>','Compte rendu intervention',NULL,1,NULL,NULL,1,0),
(138,_binary '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0//EN\" \"http://www.w3.org/TR/REC-html40/strict.dtd\">\n<html><head><meta name=\"qrichtext\" content=\"1\" /><style type=\"text/css\">\np, li { white-space: pre-wrap; }\n</style></head><body style=\" font-family:\'Comic Sans MS\'; font-size:13pt; font-weight:400; font-style:normal;\">\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Laboratoires OPHTALMIC,</p>\n<p align=\"right\" style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">0820777515</p>\n<p style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Monsieur,</p>\n<p style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Pourriez vous faire parvenir à mon cabinet les lentilles suivantes:</p>\n<p style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">OPHTALMIC RXm TORIC progressive</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">{{KERATOMETRIE}}</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">Refraction lunettes</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">{{REFRACTION}}</p>\n<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">pour {{TITRE PATIENT}} {{PRENOM PATIENT}} {{NOM PATIENT}}</p>\n<p style=\" margin-top:12px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">En vous remerciant.</p></body></html>','Commande lentilles Ophtalmic Rxm Toric Prog',NULL,1,1,NULL,1,NULL),
(139,_binary '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0//EN\" \"http://www.w3.org/TR/REC-html40/strict.dtd\">\n<html><head><meta name=\"qrichtext\" content=\"1\" /><style type=\"text/css\">\np, li { white-space: pre-wrap; }\n</style></head><body style=\" font-family:\'Comic Sans MS\'; font-size:13pt; font-weight:400; font-style:normal;\">\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">	<span style=\" font-weight:600;\">ISOPTO-PILOCARPINE 2%</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">	Une goutte dans ((côté à traiter//COTE)) une heure avant le prochain examen</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">	<span style=\" font-weight:600;\">CHIBROCADRON</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">	Une goutte dans ((côté à traiter//COTE)), 3 fois par jour pendant huit jours,</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">	en commençant le matin de l\'examen</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">	<span style=\" font-weight:600;\">LACRIGEL 10g</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">	Un tube</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">	CÉBÉSINE</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">	Un flacon</p></body></html>','Myosis avant ALT ou IP',NULL,1,1,1,1,1),
(142,_binary '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0//EN\" \"http://www.w3.org/TR/REC-html40/strict.dtd\">\n<html><head><meta name=\"qrichtext\" content=\"1\" /><style type=\"text/css\">\np, li { white-space: pre-wrap; }\n</style></head><body style=\" font-family:\'Comic Sans MS\'; font-size:13pt; font-weight:400; font-style:normal;\">\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">	<span style=\" font-weight:600;\">Blepahademodex</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">		 </span>2 boîtes</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">	<span style=\" font-weight:600;\">Naviblef mousse paupière</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">		 </span>1 flacon</p></body></html>','Blephademodex',NULL,1,1,1,1,1),
(143,_binary '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0//EN\" \"http://www.w3.org/TR/REC-html40/strict.dtd\">\n<html><head><meta name=\"qrichtext\" content=\"1\" /><style type=\"text/css\">\np, li { white-space: pre-wrap; }\n</style></head><body style=\" font-family:\'Comic Sans MS\'; font-size:13pt; font-weight:400; font-style:normal;\">\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">ODM5</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">une goutte dans l\'oeil ((quel oeil//COTE)) 4 fois par jor pendant 1 mois</p></body></html>','ODM5',NULL,1,1,1,NULL,1),
(144,_binary '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0//EN\" \"http://www.w3.org/TR/REC-html40/strict.dtd\">\n<html><head><meta name=\"qrichtext\" content=\"1\" /><style type=\"text/css\">\np, li { white-space: pre-wrap; }\n</style></head><body style=\" font-family:\'Comic Sans MS\'; font-size:13pt; font-weight:400; font-style:normal;\">\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">	<span style=\" font-weight:600;\">DIAMOX</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">	1/2 comprimé matin, midi et soir pendat 15 jours</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">	<span style=\" font-weight:600;\">KALEORID</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">	1 comprimé tous les 2 jours pendant 15 jours</p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">	manger très peu salé</p></body></html>','Diamox',NULL,1,1,1,1,1),
(145,_binary '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0//EN\" \"http://www.w3.org/TR/REC-html40/strict.dtd\">\n<html><head><meta name=\"qrichtext\" content=\"1\" /><style type=\"text/css\">\np, li { white-space: pre-wrap; }\n</style></head><body style=\" font-family:\'Comic Sans MS\'; font-size:13pt; font-weight:400; font-style:normal;\">\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">	faire pratiquer une échographie hépatique</p></body></html>','Echo Hépatique',NULL,1,1,1,NULL,1),
(146,_binary '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0//EN\" \"http://www.w3.org/TR/REC-html40/strict.dtd\">\n<html><head><meta name=\"qrichtext\" content=\"1\" /><style type=\"text/css\">\np, li { white-space: pre-wrap; }\n</style></head><body style=\" font-family:\'Comic Sans MS\'; font-size:13pt; font-weight:400; font-style:normal;\">\n<p align=\"right\" style=\" margin-top:0px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; line-height:22px;\"><span style=\" font-weight:600;\">{{TITRE PATIENT}} {{PRENOM PATIENT}} {{NOM PATIENT}}</span></p>\n<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; line-height:22px; font-weight:600;\"><br /></p>\n<p style=\" margin-top:0px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; line-height:22px;\"><span style=\" font-weight:600;\">Vous allez bénéficier d\'une trabéculoplastie au laser SLT </span></p>\n<p style=\" margin-top:0px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; line-height:18px;\">Vous êtes atteint d’un glaucome chronique à angle ouvert, dont la pression doit être diminuée de façon plus importante. </p>\n<p style=\" margin-top:0px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; line-height:18px;\">Ce laser permet de modifier le trabéculum (filtre de l’œil situé dans l\'angle iridocornéen) et ainsi, en le rendant plus perméable, améliorer l\'évacuation de l\'humeur aqueuse (liquide interne de l\'œil). Il induit doucement une sorte d’auto nettoyage du filtre ; il n’agit pas par une brulure, il n’y a pas de lésion visible. </p>\n<p align=\"justify\" style=\" margin-top:0px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; line-height:18px;\">Ce laser a donc pour but de baisser la pression intra oculaire, mais l\'effet est parfois aléatoire (certains patients ne sont pas répondeurs lorsque le filtre est trop bouché) et peut s\'épuiser dans le temps (l’encrassement du filtre réapparait). Cette trabéculoplastie au laser SLT n’est possible que pour les glaucomes chroniques à angle ouvert et si le trabéculum est encore perméable sans lésion définitive. Il est toutefois possible de renouveler ce traitement, une à deux fois, si l’effet a été notable la première fois. L’efficacité est, en effet, aléatoire, et certains patients ne sont malheureusement pas répondeurs, ou la baisse de tension peut être insuffisante. </p>\n<p style=\" margin-top:0px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; line-height:18px;\"><span style=\" font-weight:600;\">La trabéculoplastie est réalisée au laser SLT</span> </p>\n<p align=\"justify\" style=\" margin-top:0px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; line-height:18px;\">Le laser est un faisceau de lumière qui peut modifier le tissu vivant sur lequel il est directement appliqué. L\'œil est un organe qui convient bien au laser, car il est composé de structures transparentes (la cornée) qui laissent facilement passer la lumière. Une opération au laser ne nécessite pas d\'ouvrir chirurgicalement l\'œil, ce qui évite la survenue d\'une infection ou d\'une hémorragie oculaire importante. La réalisation se fait en ambulatoire. </p>\n<p align=\"justify\" style=\" margin-top:0px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; line-height:18px;\"><span style=\" font-weight:600;\">Avant le laser, il est important de préparer l’œil</span> (une ordonnance vous sera remise au moment de la prise de rendez-vous) avec un traitement anti-inflammatoire, un traitement hypotonisant et une goutte pour tendre l’iris afin de faciliter la réalisation du laser. Cette dernière goutte peut être un peu douloureuse et entrainer une céphalée pendant une heure. </p>\n<p align=\"justify\" style=\" margin-top:0px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; line-height:18px;\"><span style=\" font-weight:600;\">Le Laser.</span> Après avoir appliqué quelques gouttes de collyres anesthésiants sur l\'œil du patient, le médecin réalise plusieurs impacts de laser sur le trabéculum en utilisant une sorte de microscope (appelé « lampe à fente ») relié à un générateur de faisceau laser.<br />Le spécialiste demande au patient, assis devant la machine, de ne pas bouger l\'œil durant la séance. L\'immobilité est facilitée par l\'utilisation d\'un verre de contact posé sur l\'œil. La séance de laser dure quelques minutes et ne nécessite pas d\'hospitalisation. La trabéculoplastie au laser permet de baisser la pression intra oculaire après une seule séance mais l’effet met un à deux mois à être maximum. </p>\n<p align=\"justify\" style=\" margin-top:0px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; line-height:18px;\"><span style=\" font-weight:600;\">Après le laser,</span> vous pourrez repartir immédiatement mais sans pouvoir conduire car la vision de l’œil traité est brouillée pendant quelques heures. Le lendemain, il est possible de travailler et de conduire. Un traitement anti inflammatoire est nécessaire pendant une semaine. Mais, il est impératif de continuer votre traitement habituel contre la tension car le laser peut mettre plusieurs semaines à agir.</p>\n<p align=\"justify\" style=\" margin-top:0px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; line-height:18px;\"><span style=\" font-weight:600;\">Une consultation de contrôle</span> devra être effectuée six semaines après le traitement.</p>\n<p align=\"justify\" style=\" margin-top:0px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; line-height:18px;\">Ce laser entraine peu de complication, en dehors de très rares cas de réaction inflammatoire réversible après traitement, surtout chez le myope fort. Si le lendemain du laser la vision est très brouillée, il faudra mettre davantage de gouttes anti-inflammatoires comme indiqué sur l\'ordonnance. </p>\n<p align=\"center\" style=\" margin-top:0px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; line-height:18px;\">Le laser est coté BENP001 par œil et facturé 150 €<br />Il sera remboursé par la Sécurité Sociale sur la base de 125.40 €<br />Mais le complément d’honoraire demandé peut être pris en charge par votre mutuelle  </p></body></html>','Info trabeculoplastie SLT',NULL,1,1,NULL,NULL,1),
(147,_binary '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0//EN\" \"http://www.w3.org/TR/REC-html40/strict.dtd\">\n<html><head><meta name=\"qrichtext\" content=\"1\" /><style type=\"text/css\">\np, li { white-space: pre-wrap; }\n</style></head><body style=\" font-family:\'Comic Sans MS\'; font-size:13pt; font-weight:400; font-style:normal;\">\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">	<span style=\" font-weight:600;\">ISOPTO-PILOCARPINE 2%</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">	Une goutte dans ((côté à traiter//COTE)) une heure avant le prochain examen</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">	<span style=\" font-weight:600;\">OCUFEN</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">	Une goutte dans ((côté à traiter//COTE)), 3 fois par jour pendant huit jours,</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">	en commençant le matin de l\'examen</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">	<span style=\" font-weight:600;\">LACRIGEL 10g</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">	Un tube</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-weight:600;\">	CÉBÉSINE</span></p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">	Un flacon</p></body></html>','Myosis avant SLT',NULL,1,1,1,1,1),
